import '../../css/header.css';

const Header = () => {

    return (
            <section id="heading">
                <nav id="navbar-row" class="navbar navbar-expand-lg">
                    <div class="navbar-brand-section">
                        <h3 class="navbar-brand">AbdulM95</h3>
                    </div>
                    <div class="links ml-auto">
                        <a class="link" href="index.html">Home</a>
                        <a class="link" href="resume.html">Resume/CV</a>
                        <a class="link" href="about.html">About</a>
                        <a class="link" href="skills.html">Skills</a>
                        <a class="link" href="leisure.html">Leisure</a>
                    </div>
                </nav>
            </section>
    )
}

export default Header;
